$(document).ready(function() {
        // Hide all tab panes initially except the first one
        $('#wwc_tabs .tab-pane').hide();


        if (location.hash) {
          $('a[href="' + location.hash + '"]').addClass('active');
          $(location.hash).show();
        } else {
          // Default to the first tab if no hash is present
          $('#linktab_4').addClass('active');
          $('#tabs4').show();
        }


        $('#wwc_tabs').on('click', 'a', function (e) {
          e.preventDefault();

          $('#wwc_tabs .tab-pane').hide();

          var targetId = $(this).attr('href');
          $(targetId).show();

          $('#wwc_tabs a').removeClass('active');
          $(this).addClass('active');


          window.location.hash = targetId;
        });
      });


function connectToServer(serverUrl, serverName, roomId) {
  try {
    // Check for the required functions in the parent window
    if (window.parent._anApp && typeof window.parent._anApp.bo === 'function') {
      console.log("Connecting to server:", serverName, "at URL:", serverUrl, "with room:", roomId);

      $("#connection-status").html(`جاري الاتصال بالسيرفر: <strong>${serverName}</strong>`);

      // إيقاف الصوت (إذا كان متاحًا)
      if (window.parent._anApp.Si && typeof window.parent._anApp.Si.Se === 'function') {
        window.parent._anApp.Si.Se();
      }

      // الاتصال بالسيرفر
      window.parent._anApp.bo(serverUrl);
      $("#connection-status").html(`تم الاتصال بنجاح: <strong>${serverName}</strong>`);
      return true;
    }
  } catch (e) {
    console.error("خطأ في الاتصال بالسيرفر:", e);
  }

  // المحاولة البديلة
  try {
    let httpUrl = serverUrl.replace('wss://', 'https://').replace('ws://', 'http://');
    httpUrl = httpUrl.split('/wormy')[0] + '?room=' + roomId;

    window.open(httpUrl, '_blank');
    $("#connection-status").html(`تم فتح السيرفر في نافذة جديدة: <strong>${serverName}</strong>`);
    return true;
  } catch (e) {
    console.error("فشل في فتح عنوان السيرفر:", e);
    $("#connection-status").html(`فشل الاتصال بالسيرفر: <strong>${serverName}</strong>`);
    return false;
  }
}
